import React from "react";
import "./styles/Item.css";
import "./styles/ItemList.css";

class Item extends React.Component {
  render() {
    return (
      <div className="Item">

        </div>

    );
  }
}

class ItemList extends React.Component {
  render() {
    return (
      <div className="row">

          {this.props.items.map(item => {
            return (
              <div className="col-4">
                <Item info= {item}/>
              </div>
            );
          })}
      </div>
    );
  }
}

export default ItemList;
